import { useEffect, useState } from "react";

const useHighscores = () => {
  const [highscores, setHighscores] = useState([]);

  const getHighscores = async () => {
    const res = await fetch("/api/highscores");
    const data = await res.json();
    console.log(data);
    setHighscores(data);
  };

  useEffect(() => {
    getHighscores();
  }, []);

  return { highscores };
};

export default useHighscores;
